define([],function(){var n={};return n["project-team-details"]='<div class="dialog wide">\r\n    <div class="float-left clickable" v-on:click="cancel">&#x2715;</div>\r\n    <div class="caption">\r\n        קבוצה\r\n        {{team.id}}\r\n        -\r\n        פרטים נוספים\r\n    </div>\r\n    <div class="ph-md" style="overflow: auto;">\r\n        <div class="pb-sm" style="display: flex; flex-wrap: wrap; justify-content: space-between; margin: 5px; line-height: 30px;">\r\n            <div>\r\n                <span>ענף:</span>\r\n                <span style="color: blue;">\r\n                    {{team.sport.name}}\r\n                    <span> {{getGender(team.sport.gender)}}</span>\r\n                </span>\r\n            </div>\r\n            <div>\r\n                <span>גילאים:</span>\r\n                <span style="color: blue;">{{getAgesText(team.ages)}}</span>\r\n            </div>\r\n            <div>\r\n                <span>מתקן:</span>\r\n                <span style="color: blue;">{{team.facility.name}}</span>\r\n            </div>\r\n            <div>\r\n                <span>כתובת מתקן:</span>\r\n                <span style="color: blue;">{{team.facility.address}}</span>\r\n            </div>\r\n            <div>\r\n                <span>סוג מתקן:</span>\r\n                <span style="color: blue;">{{team.facility.type}}</span>\r\n            </div>\r\n            <div>\r\n                <span>ימי אימון:</span>\r\n                <span style="color: blue;">{{getActivityText(team.activity)}}</span>\r\n            </div>\r\n            <div>\r\n                <span>שם מאמן/ת:</span>\r\n                <span style="color: blue;">{{team.coach.name}}</span>\r\n            </div>\r\n            <div>\r\n                <span>טלפון מאמן/ת:</span>\r\n                <span style="color: blue;">{{team.coach.phoneNumber}}</span>\r\n            </div>\r\n            <div>\r\n                <span>מייל מאמן/ת:</span>\r\n                <span style="color: blue;">{{team.coach.email}}</span>\r\n            </div>\r\n            <div>\r\n                <span>מגדר מאמן/ת:</span>\r\n                <span style="color: blue;">{{team.coach.gender == 1 ? \'זכר\' : \'נקבה\'}}</span>\r\n            </div>\r\n            <div>\r\n                <span>הסמכת מאמן/ת:</span>\r\n                <span style="color: blue;">{{getCertificationText(team.coach.certification)}}</span>\r\n            </div>\r\n            <div>\r\n                <span>אישור מנהל/ת פרוייקט:</span>\r\n                <span style="color: blue;">{{isApprovedByAdmin(team)}}</span>\r\n            </div>\r\n            <div>\r\n                <span>אישור מפקח/ת מחוז:</span>\r\n                <span style="color: blue;">{{isApprovedBySportAdmin(team)}}</span>\r\n            </div>\r\n            <div>\r\n                <span>האם הקבוצה מאושרת?</span>\r\n                <span style="color: blue;">{{isApproved(team)}}</span>\r\n            </div>\r\n        </div>\r\n        <div v-if="team.players && team.players.length > 0">\r\n            <table class="table" style="width: 100%; margin-bottom: 25px;">\r\n                <caption style="font-weight: bold;">רשימת שחקנים</caption>\r\n                <thead>\r\n                <tr>\r\n                    <th style="text-align: center">שם פרטי</th>\r\n                    <th style="text-align: center">שם משפחה</th>\r\n                    <th style="text-align: center">תעודת זהות\\דרכון</th>\r\n                    <th style="text-align: center">מספר תעודת זהות\\דרכון</th>\r\n                    <th style="text-align: center">שנת לידה</th>\r\n                    <th style="text-align: center">מגדר</th>\r\n                    <th style="text-align: center">האם משתייך לפרויקט פלא?</th>\r\n                    <th style="text-align: center"> תאריך הצטרפות לפרויקט פלא</th>\r\n                </tr>\r\n                </thead>\r\n                <tbody>\r\n                <tr v-for="(player, index) in team.players">\r\n                    <td align="center">{{player.firstName}}</td>\r\n                    <td align="center">{{player.lastName }}</td>\r\n                    <td align="center">{{getIdType(player.idNumberType)}}</td>\r\n                    <td align="center">{{player.idNumber}}</td>\r\n                    <td align="center">{{player.yearOfBirth}}</td>\r\n                    <td align="center">{{getPlayerGender(player.gender)}}</td>\r\n                    <td align="center">{{getIsPele(player.isPele)}}</td>\r\n                    <td align="center">{{player.peleJoinDate}}</td>\r\n                </tr>\r\n                </tbody>\r\n            </table>\r\n        </div>\r\n    </div>\r\n    <div class="pb-md" style="text-align: center;">\r\n        <button type="button" class="btn wide" v-on:click="confirm()">חזרה למסך קבוצות</button>\r\n    </div>\r\n</div>',n["project-teams-approval"]='<div class="vertical-flex" style="position: absolute; left: 0px; right: 0px;">\r\n    <div class="ph-lg pt-lg">\r\n        <div class="float-right">\r\n            <strong>\r\n                אישור מפקח\r\n            </strong>\r\n        </div>\r\n\r\n        <div class="float-left" v-bind:style="{border: user.delegatedUser != null ? \'1px dashed black\' : \'\',\r\n            padding: user.delegatedUser != null ? \'5px 5px 5px 5px\' : \'inherit\'}">\r\n            <strong v-if="user.delegatedUser">\r\n                {{user.delegatedUser.name}}\r\n                &larr;\r\n                מחובר בתור\r\n                &larr;\r\n            </strong>\r\n            <strong>\r\n                {{user.name}}\r\n                <span v-if="loggedUser && loggedUser.region > 0">\r\n                    (מחוז\r\n                    {{loggedUser.regionName}})\r\n                </span>\r\n            </strong>\r\n            <strong style="color: blue; cursor: pointer" v-on:click="logout()">\r\n                התנתק\r\n            </strong>\r\n        </div>\r\n    </div>\r\n\r\n    <div class="flex-fill ph-lg pv-sm">\r\n        <div class="panel p-sm" style="width: auto; position: absolute; left: 39px; right: 39px; top: 13px; bottom: 0px;">\r\n            <data-table ref="table" v-bind:enableExport="true" v-bind:columns="columns" v-bind:data="teams" v-on:selection-change="handleSelectionChange()">\r\n                <div>\r\n                    <label>עונה</label>\r\n                    <select  style="width: 100%;" v-model="season">\r\n                        <option v-for="season in seasons" v-bind:value="season.Id">{{season.Name}}</option>\r\n                    </select>\r\n                </div>\r\n                <div style="display: flex; flex-direction: row; align-items: center;">\r\n                    <label style="color: white">&nbsp</label>\r\n                    <button class="btn small ml-md" v-on:click="approveTeams()" v-if="selectedStatus != 1" v-bind:disabled="selectedStatus != 0">אישור קבוצות</button>\r\n                    <button class="btn small ml-md" v-on:click="clearTeamsApprove()" v-if="selectedStatus == 1">ביטול אישור</button>\r\n                    <button class="btn small ml-md" v-on:click="openTeamDetails()" v-bind:disabled="selectedTeamsCount !== 1">פרטים נוספים</button>\r\n                    \x3c!--<div style="display: flex">--\x3e\r\n                    <div style="white-space: nowrap; padding-left: 10px"> סה"כ קבוצות <strong>{{totalTeams}}</strong></div>\r\n                    <div style="white-space: nowrap; padding-left: 10px"> עומד בקריטריון <strong>{{totalOkTeams}} </strong></div>\r\n                    <div style="white-space: nowrap; padding-left: 10px"> לא עומד בקריטריון <strong>{{totalNotOkTeams}} </strong></div>\r\n                    <div style="white-space: nowrap; padding-left: 10px"> סה"כ קבוצות מאושרות <strong>{{totalApprovedTeams}} </strong></div>\r\n                </div>\r\n                \x3c!--</div>--\x3e\r\n                \x3c!--</div>--\x3e\r\n            </data-table>\r\n        </div>\r\n    </div>\r\n\r\n</div>',n});